import React,{Component} from 'react';
import TopNavLeftIcon from './TopNavLeftIcon';
import TopNavRightIcon from './TopNavRightIcon';




class TopNav extends Component {
     
    render() {
        return (
            <div className="row top-nav">
               <TopNavLeftIcon />
               <TopNavRightIcon />
            </div>
        )
    };
}
export default TopNav;
